import { connect, useDispatch, useSelector } from "react-redux";

import AutomationBlocks from "../../components/Automation/AutomationBlocks";
import TypesLetters from "./TypesLetters";


function AutomationButtonsBlocks(props) {

    const dispatch = useDispatch();

    const letterSelect = useSelector(state => state.stateLetters.letterSelect);

    const namesLevelBlock = [
        'LevelBlock_1',
        'LevelBlock_2',
        'LevelBlock_3',
        'LevelBlock_4',
        'LevelBlock_5',
        'LevelBlock_6'
    ];

    const [numberLevelBlock, setNumberLevelBlock] = useState(0);

    const hendlerLevelEnd = () => {

    }
    const hendlerSelectLevelBlock = (data) => {
        setNumberLevelBlock(data);
    }
    return (
        <>
            {
                letterSelect === 'X'?
                    <TypesLetters />
                    : <AutomationBlocks
                        typeLetter={props.match.params.id}
                        letterSelect={letterSelect}
                        namesLevelBlock={namesLevelBlock}
                        onclick={hendlerSelectLevelBlock}
                        letterAutomation={letterSelect}
                        numberLevelBlock={numberLevelBlock}
                    />
            }
        </>   
     )
}

export default connect()(AutomationButtonsBlocks)
